drop table if exists users CASCADE;
drop table if exists connections CASCADE;
drop table if exists chat_rooms CASCADE;
drop table if exists industry_codes CASCADE;
drop table if exists user_industry_codes CASCADE;

select * from users;
select * from connections;
select * from chat_rooms;
select * from industry_codes;
select * from user_industry_codes;

create table users (
id serial primary key,
auth0_id text unique not null,
first_name text,
last_name text,
picture text,
email text,
isApplicant boolean,
isRecruiter boolean,
current_job text,
industry_code text,
looking_for text,
preferred_location text,
current_zipcode integer,
work_history text,
education_background text,
bio text,
active boolean,
attachment text
);


create table connections(
id serial primary key,
recruiter_id text,
applicant_id text,
recruiter_decision boolean,
applicant_decision boolean
);

create table messages(
id serial primary key,
connection_id integer references connections(id),
date timestamp,
message text,
sender integer references users(id)
);


create table industry_codes(
id serial primary key,
industry_name text,
industry_for text
)

create table user_industry_codes(
id serial primary key,
user_id integer references users(id),
industry_code integer references industry_codes(id)
)

create table chat_rooms(
id serial primary key,
connection_id integer references connections(id),
room_id integer,
room_name text
)




select * from industry_codes


